import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='main'>
                <div className='container-fluid cabecera'>
                    <div className='content row'>
                        <div className='logo'>
                            Hola
                        </div>
                        <div className='opciones'>text-align: center;</div>
                    </div>
                </div>
                <div>Body</div>
            </div>
            <style global jsx>{`
                *{
                    box-sizing: border-box;
                }
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                    margin:0; padding:0;
                }

                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                }

                .cabecera{
                    width: 100%;
                    height: 5%;
                    border: solid 1px;
                    padding: auto;
                    justify-content: center;
                    align-items: center;
                }     

                .cabecera .content{
                    width: 100%;
                    border: solid 1px;
                }

                .cabecera .content .logo{
                    width: 10%;
                    height: 100%;

                }

                .cabecera .content .opciones{
                    width: 90%;  
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
